import React from "react";
import "./navbar.css";
import { NavLink } from "react-router-dom";

export const Navbar = () => {
  return (
    <header>
      <div className="logo">
        <NavLink to="/">Logo</NavLink>
      </div>
      <nav>
        <li>
          <NavLink to="/home">HOME</NavLink>
        </li>
        <li>
          <NavLink to="#">ABOUT</NavLink>
        </li>
        <li>
          <NavLink to="#">CONTACT</NavLink>
        </li>
        <li>
          <NavLink to="#">SERVICES</NavLink>
        </li>
      </nav>
    </header>
  );
};
